import { Wrapper, Content, Input } from "./Playlist.styles.js";

const Playlist = (tracks) => (
  <Wrapper>
    <Content>
      <Input>
      {tracks.map((track) => (
      <li key={i}>
        <h3>{track.track.name}</h3>
        <h3>{track.track.album.name}</h3>
          <div>
          {track.track.artists.map((artist, i) => (
            <span key={i}>
            {artist.name}
            </span>
                  ))}
                </div>
      </li>
      ))}
      </Input>
    </Content>
  </Wrapper>
);

export default Playlist;
